import React from "react";
import { NavLink } from "react-router-dom";

const Home = () => {
  return (
    <>
      <section id="header" className="">
        <div className="container-fluid nab_bg">
          <div className="row">
            <div className="col-10 mx-auto">
              <div className="col-md-6 pt-5 pt-lg-3 order-2 order-lg-1">
                <h1>
                  Grow Your Business with <strong className="brand_name"> Bootstrap </strong>
                </h1>
                <h4 className="my-3">
                    We are the team of talented developer making websites
                </h4>
                <div className="mt-3">
                    <NavLink to="/contact" className="btn btn-outline-info">Get Started</NavLink>
                </div>
                <div className="col-lg-6 order-1 order-lg-2">

                </div>
              </div>
            </div>
          </div>
        </div>
      </section>
    </>
  );
};

export default Home;
